import React from 'react';
import './Card.css'

const classicCards = {
    height: "100px",
    width: "50px",
    padding: "50px",
    border: "1px solid black",
}

const tarunCards = {
  height: "150px",
  width: "150px",
  padding: "50px",
  border: "1px solid blue",
}

function Card (props){
    return (
        <div style={classicCards}>
            <img src = {props.suit} alt="suit" width="40px" height="80px"/>
            {props.number}
        </div>
    );
}

function CardTarun (props){
  return(
    <div style = {tarunCards}>
      {props.question}
    </div>
  )
}

export default Card;
